export default function GoogleLoginß():JSX.Element {
  return (  
  <GoogleLogin
      clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
      buttonText="Login"
      onSuccess={googleLogin}
      onFailure={onFailure}
      cookiePolicy={'single_host_origin'}
  />);
};
